// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./interfaces/AggregatorV3Interface.sol";

contract PriceFetcher {

    AggregatorV3Interface internal btcPriceFeed;
    AggregatorV3Interface internal ethPriceFeed;

    constructor() {
        btcPriceFeed = AggregatorV3Interface(0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e);
        ethPriceFeed = AggregatorV3Interface(0x694AA1769357215DE4FAC081bf1f309aDC325306);
    }

    // Get only BTC Price
    function getBTCPrice() public view returns (int) {
        (,int price,,,) = btcPriceFeed.latestRoundData();
        return price;
    }

    // Get only ETH Price
    function getETHPrice() public view returns (int) {
        (,int price,,,) = ethPriceFeed.latestRoundData();
        return price;
    }

    // Get BTC full feed data for debugging
    function getBTCPriceDetails() public view returns (
        uint80 roundId,
        int price,
        uint startedAt,
        uint timeStamp,
        uint80 answeredInRound
    ) {
        return btcPriceFeed.latestRoundData();
    }

    // Get ETH full feed data for debugging
    function getETHPriceDetails() public view returns (
        uint80 roundId,
        int price,
        uint startedAt,
        uint timeStamp,
        uint80 answeredInRound
    ) {
        return ethPriceFeed.latestRoundData();
    }
}

